import React, { Component } from 'react'
import { Navbar, Container } from "react-bootstrap";

import AddData from './AddData';
import DisplayData from './DisplayData';
import LoveFramesApp from './LoveFramesApp';

export class MainBody extends Component {
    constructor(props){
        super(props);
    }

  render() {
    return (
        <div>
        <Navbar variant="dark" bg="dark" expand="lg">
          <Container fluid>
            <Navbar.Brand>                    
              <ul>
                <li><h3>Main</h3></li>
                <li><h4><u>Display Data</u></h4></li>
                <li><h4><u>Add Data</u></h4></li>
              </ul>
            </Navbar.Brand>
          </Container>
        </Navbar>

        {
          this.props.triggerApp=== 'Love Photo Frames' && 
          <LoveFramesApp
            trigger={this.props.trigger} 
            setTrigger={this.props.setTrigger} 
            pic={this.props.pic} 
            setPic={this.props.setPic} 
            dataTrigger={this.props.dataTrigger}
            setDataTrigger={this.props.setDataTrigger}
          /> 
        }
     </div>
    )
  }
}

export default MainBody
